import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../../Gif/logo.png';

const emptylist = empty => {
  const input = document.getElementById('search');
  input.innerHTML = '';
  empty(1);
};
const Navbar = props => {
  return (
    <nav style={{ width: window.innerWidth > 500 && '98.5%' }}>
      <img src={logo} alt='SL Ice&Store' />
      <div className='nav-wrapper center'>
        <div className='input-field col s11 m11 l11'>
          <input
            id='search'
            type='search'
            required
            placeholder='Inventory App'
            onChange={props.search}
          />
          <label className='label-icon' htmlFor='search'>
            <i className='material-icons'>search</i>
          </label>
          <i className='material-icons' onClick={() => emptylist(props.empty)}>
            close
          </i>
        </div>
        <Link to='/add'>
          <i className='waves-effect waves-light red lighten-2 hoverable material-icons'>
            add
          </i>
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
